  <div class="container">
    <form>
      <div class="form-group">
        <label>Nama Lengkap</label>
        <input type="text" class="form-control" id="namalengkap" placeholder="Tulis Nama" required>
      </div>
      <div class="form-group">
        <label>Tim</label>
        <select class="form-control" id="tim" required>
          <option selected>Pilih Tim</option>
          <option>Front-End</option>
          <option>Back-End</option>
          <option>Android SW</option>
        </select>
      </div>
      <div class="form-group">
        <label>Kelas & Jurusan</label>
        <select class="form-control" id="kelasjurusan" required>
          <option selected>Pilih Kelas & Jurusan</option>
          <option>X-TKJ</option>
          <option>X-TJA</option>
          <option>X-TEL</option>
        </select>
      </div>
      <div class="form-group">
        <label>NIS</label>
        <input type="number" class="form-control" id="nis" placeholder="Tulis NIS" required>
      </div>
      <div class="form-group">
        <label>Alamat</label>
        <textarea class="form-control" id="alamat" rows="4" placeholder="Tulis Alamat" required></textarea>
      </div>
      <div class="form-group">
        <div class="row">
          <div class="col">
            <label>Kota</label>
            <input type="text" class="form-control" placeholder="Tulis Kota" id="kota" required>
          </div>
          <div class="col">
            <label>KodePos</label>
            <input type="number" class="form-control" placeholder="Tulis KodePos" id="kodepos" required>
          </div>
        </div>
      </div>
      <div class="form-group">
        <label>Nomor Telepon</label>
        <input type="tel" class="form-control" id="nomortelepon" placeholder="Tulis Nomor Telepon" value="+62" required>
      </div>
      <div class="form-group">
        <label>Email</label>
        <input type="email" class="form-control" id="email" placeholder="Email" required>
      </div>
      <div class="form-group">
        <button type="button" class="btn btn-dark btn-block daftar" id="daftar">Daftar</button>
      </div>
    </form>
  </div>
  <br><br>
